import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Header from './Header/Header'; // Import your Planner component (replace with the actual path)

const App = () => {
  return (
    <div>
      <Header />
      <Routes>
        <Route exact path="/">
          {/* The home route, maybe a dashboard or something */}
          
        </Route>
        {/* Add more routes as needed */}
      </Routes>
    </div>
  );
};

export default App;
